import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import SudokuSolver from "./containers/SudokuSolver";

class App extends Component {
  render() {
    return (
      <div className="App">
          <h3>Sudoku Solver</h3>
        <SudokuSolver/>
      </div>
    );
  }
}

export default App;
